import { Link } from "react-router-dom";
import Container from "./container";
import styles from "./Navbar.module.css";
import logo from "../../img/logo.png";


function Navbar(){
    return (
        <div>
          <Container>
          <Link to="/">
            <img src={logo} alt="costs"></img>
          </Link>
           <ul>
            <li></li>
           </ul>
          </Container>
        </div>
    );
}

export default Navbar
